    - type: Paper
      content: >-
        Тема: «Трематоды, или Сосальщики: Недовольные жизнью путешественники»


        Студент: Аркадий В. (группа БП-411)

        Преподаватель: проф. С.М. Глист


        (Примечание на полях карандашом: «Аркадий, это что за цирк? Кабинет 218, ясно?»)


        Введение


        Если вы думаете, что ваша жизнь сложная, вы просто не знакомы с трематодами. Это такие плоские черви-сосальщики, чья жизнь напоминает бесконечный квест с кучей пройденных уровней, но без сохранений. Они рождаются уже злыми, потому что их детство проходит в теле улитки, а это, согласитесь, не санаторий. Цель данного доклада – не уснуть над скучными учебниками и разобраться, почему трематоды – самые неудачливые, но упрямые авантюристы животного мира.


        1. Внешний вид: «На вид приятный, но это обманка»


        Трематоды похожи на крошечные листочки или язычки. У них есть две присоски – ротовая и брюшная. Выглядит это так, будто они вечно недовольны и хотят присосаться к чему-нибудь вкусному. Ни глаз, ни ушей, ни мозга в нашем понимании у них нет. Они как типичный злодей из B-мультика: простой дизайн, но куча вредности.


        2. Жизненный цикл: «Эпичная сага со слишком большим количеством сезонов»


        Это самая захватывающая часть! Жизнь трематоды – это квест «Найди хозяина!» на максимальной сложности.


        Сезон 1: Яйцо. Всё начинается с яйца, которое выходит из конечного хозяина (например, коровы или человека) вместе с… кхм… «отходами жизнедеятельности». Не самое гламурное начало.


        Сезон 2: Улитка (Первая жертва). Из яйца вылупляется личинка (мирацидий), которая срочно ищет улитку. Залезает в неё и там превращается в нечто под названием спороциста. Спороциста – это такая фабрика по производству новых личинок (редий) прямо из своих тканей. Представьте, что вы зашли в гости к другу, а потом внутри него клонируете себя несколько раз. Жутко? А улитке как?


        Сезон 3: Выход в свет. Из улитки выползают уже другие личинки – церкарии. Они похожи на головастиков с хвостами и ищут своего второго хозяина. Часто им становится рыба или муравей.


        Сезон 4: Муравей-зомби (Блокбастер!). Вот самый крутой поворот сюжета! Один вид трематод, Dicrocoelium dendriticum, зомбирует муравья. Личинка проникает в мозг муравья и заставляет его взобраться на травинку и вцепиться в неё челюстями. Ночью муравей замерзает, а утром его вместе с травинкой съедает корова. Муравей – это буквально биодрон для доставки паразита! Если бы трематоды снимали кино, этот эпизод получил бы «Оскар».


        Сезон 5: Финальный хост. В теле коровы (или неосторожного человека, съевшего плохо прожаренную рыбу) личинка превращается во взрослого червя и начинает откладывать яйца. Цикл замыкается!
  - uid: 6888
    components:
    - type: Transform
      parent: 6869
    - type: Paper
      content: >-
        Вывод


        Трематоды – это не просто паразиты. Это настоящие неудачливые стратеги, которые проходят огонь, воду и медные трубы (а точнее, тела улиток, муравьев и коров), чтобы просто продолжить свой род. Их жизнь сложна, бессмысленна и очень запутана. Они учат нас простой истине: всегда хорошо прожаривайте рыбу и мойте руки, потому что в мире есть кто-то, кто очень хочет в вас поселиться и устроить свой личный многосерийный хоррор.


        Список литературы (написано небрежно)


        Какой-то учебник.


        Статья в интернете.


        Мне приснилось.


        (На обороте листа нарисован карандашный комикс: улыбающийся червяк с присосками говорит муравью: «Давай, залезь на ту травинку, там клёво!», а на заднем плане корова с недоуменным выражением лица).
