  - uid: 9512
    components:
    - type: Transform
      parent: 9511
    - type: Paper
      content: >-
        Всё ещё трудно поверить в то, что случилось с Сосновском. Всего шестьдесят километров по шоссе, а кажется, что это другой мир, другая планета. Мы до последнего думали, что новости – это панические слухи. Помнишь, мы смеялись над их ежегодной ярмаркой меда? Теперь оттуда не доносится ни звука. Только иногда, ночью, горизонт со стороны закаулка озаряется чужим, холодным свечением.


        Здесь, в спальном районе, жизнь изменилась до неузнаваемости. Город похож на спящего ежа. Все въезды перекрыты сеткой и колючей проволокой, патрули на улицах днём и ночью. Комендантский час с восьми вечера. В витринах магазинов вместо товаров – мешки с песком. Абсурд.


        Но люди… люди пытаются жить. Стараются. Старый сапожник Михалыч до сих пор чинит обувь, говорит, «пока люди ходят, всё не пропало». Мама ходит в наш огородик за домом, полет сорняки. Говорит, что земля должна чувствовать заботу. Это придает ей сил. А мне – спокойствия...
    - type: Physics
      canCollide: False
