    - type: Paper
      content: >
        День 1 от тревоги.

        Гражданская оборона и жандармы вытащили большую часть продуктов под предлогом государственой реквизиции. Надеюсь меня не уволят за то. что я всё отдала...

        Я боюсь идти к гражданской обороне. Они у меня прямо за стенкой, но я боюсь, что они дадту мне броню, оружие и скажут воевать. Хочу в убежище.


        День 2.

        Гражанская оборона пошла заколачивать двери и окна. жандармы возводят какие-то заборчики из мешков с песком. Я прячусь в магазине. Потеряла карту с убежищами. Кажется где-то северней или восточней было одно небольшое...


        День 3.

        За окнами взрывы и стрельба. Все кричат. В магазин ворвались мародёры. тащили оставнуюся еду. Я спряталасть на складе и стала закрывать ставни на входе. Кажется одному магодёру сильно досталось от ставень.


        День 4.

        Идут бои. Очень страшно. Заедаю стресс фасолью...


        День 5.

        Не уверена, что дела идут хорошо. За стенами звуки всё страшней. Заколотила вход на склад. Поранила ногу...


        День 6.

        Заднюю дверь кто-то чем-то подпёр. Я пробовала выбить, но за ней послышались страшные звуки. Бои стихают. Надеюсь меня найдут.


        День 7.

        Боёв больше не слышно. Зато слышно рычание и скрежет. Император защити меня...


        День 8.

        На складе было не слишком много еды. У меня кончилась тушонка. остались только персики. Я ненавижу персики... раненая нога опухла и болит.


        День 9.

        Очень страшные звуки за стеной. Мне кажется, что иногда в темноте я слышу маму...


        День 10.

        Я больше не могу. У меня есть сильные лекарства... Я просто усну... это не страшно. Но нужно помолиться перед сном. Прости меня император за моё решение и не лей по мне слёз...


        «И не было более великого и счастливого мгновения для народа нашего и страны, чем тот, когда Император Миртан обрёл Силу свою и взял власть над нами всеми! Возблагодарю Бога-Императора за все радости и горести. Что ниспослал он на меня в сей день с утра и до сего момента. Возблагодарю за горести, ибо стали они мне учителями для совершенствования. Возблагодарю за радости, ибо стали они мне напоминанием величия и доброты Его. И пусть дарует он мне сон покоя полный, дабы мог на день грядущий я принести пользу в служение Ему и стране моей. Во веки вечные! Велик Бог-Император!»
