      content: >-
        УВЕДОМЛЕНИЕ № 42/11-ЧС

        о ненадлежащем содержании общего имущества и аварийном состоянии внутриквартирного трубопровода


        НАПРАВЛЕНО: 

        ФИО: Иванов Аркадий Петрович

        Адрес: г. ---- -- --- , ул. Мирная, д. 7, кв. 12

        Расчетный период: Сентябрь 3XXX г.


        Касается: Системы холодного водоснабжения (стояк, отводная ветка)


        На основании акта обхода территории, составленного старшим по подъезду гр-ном Сидоровым И.И., нами зафиксировано аварийное состояние трубопровода холодной воды в вашей квартире, а именно: полный разрыв соединения на отводе от стояка, приведший к затоплению подвала и неработоспособности системы водоснабжения у соседей снизу (кв. №1 и №2).


        Мы с глубоким пониманием относимся к текущим внешним обстоятельствам. Нам известно, что ваш район подвергается периодическим набегам агрессивной ксенобиоты, и это, безусловно, создаёт определенные бытовые неудобства.


        Однако, руководство УК «ЖилПлоащадь» вынуждено обратить ваше внимание на следующее:


        Наличие или отсутствие ксеноморфов не отменяет действия Жилищного Кодекса.


        Мы не можем допустить, чтобы из-за безответственности одного собственника десятки других жильцов остались без воды и были вынуждены существовать в антисанитарных условиях, привлекающих... внимание местной фауны.


        Вам предоставляется трое (3) суток с момента получения данного уведомления для устранения неисправности своими силами или обращения в нашу аварийную службу (вызов платный).


        В случае бездействия с вашей стороны, управляющая компания:


        - произведет ремонт принудительно с отключением всего стояка;


        - обратится в Службу Судебных Приставов-Выживших для взыскания всех затрат и долгов через конфискацию имущества, не являющегося предметом первой необходимости (патроны, аптечки, консервы подлежат изъятию в последнюю очередь).


        С уважением и надеждой на ваше благоразумие,

        Начальник Аварийно-Восстановительного Участка

        МУП «ЖилПлоащадь»

        (Подпись) /С.В. Петренко/
